import React from 'react';

// Ganti import version dari package.json
// import { version } from '../../../package.json';
const version = '2.0.0'; // Hardcode versi atau gunakan process.env.REACT_APP_VERSION

import './styles.scss';

const Footer = () => {
  return (
    <div className="footer__container">
      <span>{`Made with â™¥ by Andrew Steinheiser - v${version} - `}</span>

      <a
        className="footer__link"
        href="https://github.com/ASteinheiser/react-rpg.com"
        target="_blank"
        rel="noopener noreferrer"
      >
        {'View Source'}
      </a>
    </div>
  );
};

export default Footer;
